import "../Main.css";
import {
  BsHouse,
  BsBoxArrowRight,
  BsPersonCircle,
  BsChatLeft,
  BsInstagram,
} from "react-icons/bs";

import { useState, useEffect } from "react";

import { lg_api } from "./__modules__";

function HeadMenu() {
  const [post, setPost] = useState(null);

  console.log(post);
  useEffect(() => {
    async function FetchData() {
      const { data } = await lg_api("auth-current-user/");
      console.log(data);
      setPost(data);
    }
    FetchData();
  }, []);

  return (
    <div className="App">
      <header className="header">
        <nav className="navbar navbar-expand-lg bg-light">
          <div className="container-fluid">
            <div className="container-logo-link grid">
              <BsInstagram className="icon-gral" />
              <h1 className="fs-title">Lazygram</h1>
            </div>
            <div
              className="collapse navbar-collapse"
              id="navbarSupportedContent"
            >
              <ul className="navbar-nav mx-auto mb-2 mb-lg-0">
                {/* Home */}
                <li className="nav-item">
                  <span className="nav-link container-icons-link">
                    <BsHouse className="icon-gral" />
                  </span>
                </li>
                {/* MD */}
                <li className="nav-item">
                  <span className="nav-link container-icons-link">
                    <BsChatLeft className="icon-gral" />
                  </span>
                </li>
                {/* User */}
                <li className="nav-item">
                  <span className="nav-link container-icons-link">
                    <BsPersonCircle className="icon-gral" />
                  </span>
                </li>
                {/* Logout */}
                <li className="nav-item">
                  <span className="nav-link container-icons-link">
                    <BsBoxArrowRight className="icon-gral" />
                  </span>
                </li>
              </ul>
              <form className="d-flex" role="search">
              </form>
            </div>
          </div>
        </nav>
      </header>
    </div>
  );
}

export { HeadMenu };
